function detailRepositoryDialog(el) {
    var data = $(el).data('detail');
    $('.clear').val('');
    $('#md-Repository-detail').modal('show');

				$('#Detail-Repository-Base64').val(data.base64);
				$('#Detail-Repository-Code').val(data.code);
				$('#Detail-Repository-Description').val(data.description);
				$('#Detail-Repository-Extension').val(data.extension);
				$('#Detail-Repository-FileName').val(data.fileName);
				$('#Detail-Repository-MimeType').val(data.mimeType);
				$('#Detail-Repository-Modul').val(data.modul);

}
